import "./input.css";
import Protocol from "./pro/protocol";
import { useState } from "react";
const input = () => {
    const [bgColor, setBgColor] = useState('');
    function handleClick() {
        setBgColor('#fff');
      }
    return (<div className="input">
        <div className="inputhold"> 
        <div id="pic1" className="pic"></div>
        <input  id="input1" type="txt" placeholder="请输入统一认证码"></input>
        </div>
        <div className="inputhold">
        <div id="pic2" className="pic"></div>
        <input  id="input2" type="password" placeholder="请输入密码"></input>
        </div>
        <Protocol/>
        <div id="load">
            <button id="loadbtn" style={{backgroundColor: bgColor}} onClick={handleClick}>登录</button></div>
        </div>)
}
export default input;
